import React from 'react';
import Bg1 from '@mevron/cross-core/assets/svg-icon/color-svg/custom-1.svg';
import styled from 'styled-components';

const StatsCard = styled.div`
    background-position: right bottom;
    background-size: auto 100%;
`;

export default function Welcome() {
    return (
        <div className="box bg-primary-light">
            <div className="box-body d-flex px-0">
                <StatsCard
                    className="flex-grow-1 p-30 flex-grow-1 bg-img dask-bg bg-none-md"
                    style={{ backgroundImage: `url(${Bg1})` }}
                >
                    <div className="row">
                        <div className="col-12 col-xl-7">
                            <h2>
                                Welcome back, <strong>John!</strong>
                            </h2>

                            <p className="text-dark my-10 fs-16">
                                Your students complated <strong className="text-warning">80%</strong> of the tasks.
                            </p>
                            <p className="text-dark my-10 fs-16">
                                Progress is <strong className="text-warning">very good!</strong>
                            </p>
                        </div>
                        <div className="col-12 col-xl-5"></div>
                    </div>
                </StatsCard>
            </div>
        </div>
    );
}
